import React from "react";
import bannerImage from "../assets/services-banner.png"; // Make sure the image is in the right path

const Services = () => {
  return (
    <div>
      {/* Top Section with Banner */}
      <section
        className="relative w-full h-[400px] flex items-center justify-center text-white"
        style={{
          backgroundImage: `url(${bannerImage})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          backgroundRepeat: "no-repeat",
        }}
      >
        <div className="bg-black bg-opacity-50 p-4 rounded-md">
          <h1 className="text-4xl font-bold">Our Services</h1>
        </div>
      </section>

      {/* Below Banner Content */}
      <div className="p-8 text-center">
        <h2 className="text-2xl font-semibold">Services Page</h2>
        <p className="mt-4 text-gray-600">
          This section can include service descriptions, cards, or other content.
        </p>
      </div>
    </div>
  );
};

export default Services;
